soccerStats.controller("loginController",["$scope","$location",function(o,n){o.user={name:"",password:""},o.go=function(o){n.path(o)},o.login=function(n){o.isFormValid("loginForm")&&Parse.User.logIn(n.name,n.password,{success:function(){o.go("/home")},error:function(){console.log("failed to login")}})},o.isFormValid=function(n){return o[n]&&o[n].hasOwnProperty("$valid")?o[n].$valid:!1}}]);